import "./App.css";
import axios from "./api/axios";
import request from "./api/Api";
import { useEffect } from "react";
function App() {
  useEffect(() => {
    axios
      .get(request.fetchtrend)
      .then((dat) => {
        console.log(dat);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div className='App'>
      <h1>Hello world</h1>
    </div>
  );
}

export default App;
